import { useState, useEffect } from 'react';
import { FaYoutube } from 'react-icons/fa';
import { useNavigate } from 'react-router-dom';
import { useAuth0 } from "@auth0/auth0-react";
import './Entry.css';

export default function Entry() {
  const [inputValue, setInputValue] = useState('');
  const [showTitle, setShowTitle] = useState(false);
  const [showModal, setShowModal] = useState(false);
  const { loginWithRedirect, isAuthenticated, logout } = useAuth0();
  const navigate = useNavigate();
  const images = ['data:image/png;base64,', 
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/png;base64,',
    'data:image/jpeg;base64,'
  ];

  const handleSubmit = (e) => {
    e.preventDefault();
    if (inputValue) {
      if (isAuthenticated) {
        navigate(`/dashboard?channelId=${inputValue}`);
      } else {
        setShowModal(true);
      }
    }
  };

  useEffect(() => {
    setTimeout(() => setShowTitle(true), 1000);
  }, []);

  return (
    <div className="relative h-screen bg-gradient-animated flex items-center justify-center">
      <div className="absolute top-0 left-0 w-full h-full overflow-hidden">
        {Array.from({ length: 9 }).map((_, index) => (
          <div
            key={index}
            className={`youtube-logo youtube-logo-${index + 1}`}
            style={{
              backgroundImage: `url(${images[Math.floor(Math.random() * images.length)]})`,
            }}
          />
        ))}
      </div>
      <form
        onSubmit={handleSubmit}
        className="relative max-w-lg w-full text-center transition-all duration-300 transform hover:scale-105 z-10 glowing-border"
      >
        <h1
          className={`text-7xl font-extrabold text-transparent bg-clip-text bg-gradient-to-r from-red-600 to-red-400 mb-6 transition-opacity duration-1000 ${showTitle ? 'opacity-100' : 'opacity-0'} glow-text`}
        >
          YouTube
        </h1>
        <div className="relative mb-4">
          <input
            type="text"
            placeholder="Enter YouTube Channel ID"
            value={inputValue}
            onChange={(e) => setInputValue(e.target.value)}
            className="w-full p-4 rounded-lg border-2 border-transparent focus:outline-none focus:ring-4 focus:ring-red-500 focus:border-transparent text-lg shadow-inner transition-all duration-500 hover:border-red-400 glow-input bg-transparent text-white"
          />
          <button
            type="submit"
            className="absolute right-0 top-0 mt-2 mr-2 text-red-600 transition-transform transform hover:scale-110"
          >
            <FaYoutube size={36} />
          </button>
        </div>
        <div className="flex justify-between items-center w-full space-x-4">
          <button
            type="submit"
            className="flex-grow bg-gradient-to-r from-red-600 to-red-400 text-white py-3 rounded-lg shadow-lg hover:from-red-700 hover:to-red-500 transition-all duration-300 transform hover:scale-105"
            style={{ flexBasis: '78%' }}
          >
            Show Stats
          </button>
          {!isAuthenticated ? (
            <button
              onClick={() => loginWithRedirect()}
              className="flex-shrink bg-red-500 text-white py-3 px-2 rounded-lg shadow-lg hover:bg-red-600 transition-all duration-300 glowing-button"
              style={{ flexBasis: '18%' }}
            >
              Log In
            </button>
          ) : (
            <button
              onClick={() => logout({ logoutParams: { returnTo: window.location.origin } })}
              className="flex-shrink bg-red-500 text-white py-3 px-2 rounded-lg shadow-lg hover:bg-red-600 transition-all duration-300 glowing-button"
              style={{ flexBasis: '18%' }}
            >
              Log Out
            </button>
          )}
        </div>
      </form>
      {showModal && (
        <div className="modal fixed top-0 left-0 w-full h-full flex items-center justify-center z-50">
          <div className="modal-overlay absolute w-full h-full bg-gray-900 opacity-50" onClick={() => setShowModal(false)}></div>
          <div className="modal-container bg-white w-11/12 md:max-w-md mx-auto rounded shadow-lg z-50 overflow-y-auto">
            <div className="modal-content py-4 text-left px-6">
              <div className="flex justify-between items-center pb-3">
                <p className="text-2xl font-bold">Login Required</p>
                <div className="modal-close cursor-pointer z-50" onClick={() => setShowModal(false)}>✕</div>
              </div>
              <p className="text-gray-600">Please log in to view stats.</p>
              <div className="flex justify-end pt-2">
                <button
                  className="px-4 py-2 bg-red-500 text-white rounded-lg hover:bg-red-600 transition-all duration-300"
                  onClick={() => { setShowModal(false); loginWithRedirect(); }}
                >
                  Log In
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}







